import React,{Component} from 'react';
import './App.css';

class App extends Component {
  state = {
    contacts: []
  }
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      var properties = data;
      console.log(properties);
    })
    .catch(console.log)
  }
  render() {
    return (
      <table class="table table-bordered table-striped table-hover">
        <thead>
          <tr>
            <th>Key </th>
            <th> Value</th>
          </tr>
        </thead>
        <tbody>
          <tr ng-repeat="item properties">
            <td>{item}</td>
            <td>{{item}}</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default App;
